import React from "react";
import Link from "next/link";
import Router from "next/router";

const indexPage = props => {
  return (
    <div>
      <h1>Main</h1>
      <p>
        <Link href="/auth">
          <a>Auth</a>
        </Link>
        <button onClick={() => Router.push("/auth")}>Go To Auth</button>
      </p>
      <style jsx>
        {`
          div {
            border: 1px solid black;
          }
        `}
      </style>
    </div>
  );
};

export default indexPage;
